function clickCheckbox(e) {
    var chartTitle = ['Food', 'Crop', 'Livestock'];
    if (e.checked == true) {
        for (var i = 0; i < chartTitle.length; i++) {
            if (chartTitle[i] == e.id) {
                count = i + 1;
                var chart = '#chart' + count;
                $(chart).parent().show();
            }
        }
    } else {
        for (var i = 0; i < chartTitle.length; i++) {
            if (chartTitle[i] == e.id) {
                count = i + 1;
                var chart = '#chart' + count;
                $(chart).parent().hide();
            }
        }
    }
}

